    def submit_tra(self):
        flag = True
        data = [self.create_dey.currentText(), self.create_month.currentText(), self.create_dest.text(), self.spinBox.text(), self.label.text(), userID, [], self.spinBox.text(
        ), [self.create_dey.currentText(), self.create_month.currentText(), self.create_dest.text(), self.label.text()[6:]], self.timeEdit.time(), self.lineEdit.text()]

        if data[2] == "مقصد" or data[3] == "0":
            self.notifLable.setText("لطفا اطلاعات خواسته شده را وارد نمایید")
            flag = False

        elif int(data[1]) < int(JalaliDate.today().isoformat()[5:7]):
            self.notifLable.setText("سفر در زمان هنوز امکان پذیر نمی باشد")
            flag = False

        elif data[1] == JalaliDate.today().isoformat()[5:7] and int(data[0]) < int(JalaliDate.today().isoformat()[8:10]):
            self.notifLable.setText("سفر در زمان هنوز امکان پذیر نمی باشد")
            flag = False

        if data[10] == "تومان":
            self.notifLable.setText("لطفا اطلاعات خواسته شده را وارد نمایید")
            flag = False

        if flag:

            try:

                with open("travelDic.txt", "rb")as f:
                    output = pickle.load(f)

                output[JalaliDateTime.now().isoformat()[11:19]] = data

                with open("travelDic.txt", "wb")as f:
                    pickle.dump(output, f)

                self.notifLable.setText("ثبت سفر با موفیقیت انجام شد")

            except:

                with open("travelDic.txt", "wb")as f:
                    output = dict()
                    output[JalaliDateTime.now().isoformat()[11:19]] = data
                    pickle.dump(output, f)

                self.notifLable.setText("ثبت سفر با موفیقیت انجام شد")

    def del_acount(self):

        with open("admin.txt", "rb")as f:
            output = pickle.load(f)

        output.pop(admin[0])

        with open("admin.txt", "wb")as f:
            pickle.dump(output, f)

        with open("travelDic.txt", "rb")as f:
            output = pickle.load(f)

