    def searchTravel(self):
        self.listWidget_2.clear()
        flag = True

        data1 = [self.search_day.currentText(), self.search_month.currentText(
        ), self.search_dest.text(), self.search_origin.text()]

        if data1[2] == "مقصد" or data1[3] == "0":
            self.notifLable.setText("لطفا اطلاعات خواسته شده را وارد نمایید")
            flag = False

        elif int(data1[1]) < int(JalaliDate.today().isoformat()[5:7]):
            self.notifLable.setText("سفر در زمان هنوز امکان پذیر نمی باشد")
            flag = False

        elif data1[1] == JalaliDate.today().isoformat()[5:7] and int(data1[0]) < int(JalaliDate.today().isoformat()[8:10]):
            self.notifLable.setText("سفر در زمان هنوز امکان پذیر نمی باشد")
            flag = False

        if flag:

            with open("travelDic.txt", "rb")as f:
                output = pickle.load(f)

            resTravel = []

            for id, item in output.items():
                if data1 in item:
                    travelStr = f"{id} - date: - {item[1]}\\{item[0]} - time: {item[-2]} - origin: {item[4][6:]} - destination: {item[2]} - current capacity:{item[7]} - price: {item[10]}"
                    resTravel.append(travelStr)

            self.stackedWidget_2.setCurrentIndex(1)
            self.listWidget_2.addItems(resTravel)
            self.notifLable.setText(
                f" در جست و جو تعداد {len(resTravel)} سفر پیدا شد")

