    def createCode(self):
        import random as r
        chars = "1234567890QWERTYUIOASDFGHJKLZXCVBNM"
        str = ''
        for _ in range(4):
            str += r.choice(chars)

        return str

    def registerToTravel(self):
        key = self.listWidget_2.currentItem().text()[0:8]
        flag = True
        code = self.createCode()

        userdata = [self.name_input.text(), self.meliCode_input.text(
        ), self.number_input.text(), code, self.passangerNumber_input.text()]

        with open("travelDic.txt", "rb")as f:
            output1 = pickle.load(f)

        if int(output1[key][7]) <= int(userdata[-1]):
            self.notifLable.setText("ظرفیت اتوبوس کمتر از تعداد مسافرین شما است")
            flag = False
        if 30 <= int(userdata[-1]):
            self.notifLable.setText("تعداد مسافرین بیش از حد مجاز")
            flag = False

        if userdata[1] == "نام و نام خانوادگی " or userdata[2] == "کد ملی" or userdata[2] == "شماره تماس" :
            self.notifLable.setText("لطفا اطلاعات خواسته شده را وارد نمایید")
            flag = False

        if flag:

            with open("travelDic.txt", "rb")as f:
                output = pickle.load(f)

            list1 = output[key][6]
            list1.append(userdata)

            val = output[key]
            x = val[7]
            z = int(x)
            z -= int(userdata[-1])
            output[key][7] = z

            with open("travelDic.txt", "wb")as f1:
                pickle.dump(output, f1)

            self.stackedWidget_2.setCurrentIndex(0)

            with open("travelDic.txt", "rb")as f:
                output1 = pickle.load(f)

            price = int(self.passangerNumber_input.value())*int(output1[key][10])

            self.notifLable.setText(
                f"خرید شما با پرداخت مبلغ {price} ثبت گردید   کد پیگیری: {code}")

