    def findTravel(self):

        self.stackedWidget_2.setCurrentIndex(4)
        ticketlist = dict()

        with open("travelDic.txt", "rb")as f:
            output1 = pickle.load(f)

        code = self.code_input.text()

        for id, eachtravel in output1.items():
            for passanger in eachtravel[6]:
                if code in passanger:
                    ticketlist[id] = eachtravel
        resTravel = []

        for id, item in ticketlist.items():
            travelStr = f"{id}-date: {item[1]}\\{item[0]} time: {item[-2]} origin: {item[4][6:]}  destination: {item[2]}  current capacity:{item[7]} price: {item[10]} "
            resTravel.append(travelStr)

        self.listWidget_3.addItems(resTravel)

    def delTravel(self):
        key = self.listWidget.currentItem().text()[4:12]

        with open("travelDic.txt", "rb")as f:
            output1 = pickle.load(f)
        output1.pop(key)

        with open("travelDic.txt", "wb")as f:
            pickle.dump(output1, f)

        self.listWidget.clear()
        self.getTravel()
        self.notifLable.setText("سفر مورد نظر با موفقیت حذف شد")

    def delTicket(self):

        code = self.code_input.text()

        with open("travelDic.txt", "rb")as f:
            output1 = pickle.load(f)

        for id, val in output1.items():
            for passenger in val[6]:
                if code in passenger:
                    output1[id][6].remove(passenger)
                    x=output1[id][7]
                    output1[id][7]=int(x)+int(passenger[-1])


        with open("travelDic.txt", "wb")as f:
            pickle.dump(output1, f)

        with open("travelDic.txt", "rb")as f:
            output2 = pickle.load(f)
        self.listWidget_3.clear()

        resTravel = []

        for id, item in output2.items():
            for passen in item[6]:
                if code in passen:
                    travelStr = f"{id}-date: {item[1]}\\{item[0]} time: {item[-2]} origin: {item[4][6:]}  destination: {item[2]}  current capacity:{item[7]} price: {item[10]} "
                    resTravel.append(travelStr)

        self.listWidget_3.addItems(resTravel)


